##
#   Tuning
##


[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
#    The folder where the results will be stored. It will be created if it doesn't exist.
number_of_results_to_keep: 3
#    The number of results to keep in the result_folder. The oldest results will
#    be automatically deleted after each runs.
#keep_raw_csv: False
#    If True, the raw CSV files will be kept in the result_folder alongside the
#    PNG graphs. If False, they will be deleted and only the graphs will be kept.
show_macros_in_webui: True
#    Mainsail and Fluidd doesn't create buttons for "system" macros that are not in the
#    printer.cfg file. If you want to see the macros in the webui, set this to True.
timeout: 300
#    The maximum time in seconds to let Shake&Tune process the CSV files and generate the graphs.

#####################################################################
#   Macros
#####################################################################

[include macro.cfg]
[include squiggly_purge.cfg]

#    Filament Change
[gcode_macro M600]
gcode:
    #LCDRGB R=0 G=1 B=0   ; Turn LCD green
    SET_LED LED="rgb_light" RED=0 GREEN=1 BLUE=0 WHITE=0 SYNC=0 TRANSMIT=1
    PAUSE                ; Pause

[gcode_macro PRIME_LINE]
gcode:
    SQUIGGLY_PURGE

# Homing
[gcode_macro G32]
gcode:
    SAVE_GCODE_STATE NAME=STATE_G32
    G90
    G28
    QUAD_GANTRY_LEVEL
    G28
    ##  Uncomment for 350mm build
    G0 X175 Y175 Z30 F3600
    RESTORE_GCODE_STATE NAME=STATE_G32

[gcode_macro WIPE_NOZZLE]
gcode:
    SET_LED LED="rgb_light" RED=0 GREEN=0 BLUE=1 WHITE=0 SYNC=0 TRANSMIT=1

[gcode_macro PRIME_NOZZLE]
gcode:
    SET_LED LED="rgb_light" RED=0 GREEN=0 BLUE=1 WHITE=0 SYNC=0 TRANSMIT=1
    SQUIGGLY_PURGE
   
#   Use PRINT_START for the slicer starting script - please customise for your slicer of choice
[gcode_macro PRINT_START]
gcode:
    {% set target_bed = params.BED|int %}
    {% set target_extruder = params.EXTRUDER|int %}
    {% set target_offset = params.OFFSET|default("0.06")|float %}
    {% set target_chamber = params.CHAMBER|default("70")|int %}
    {% set x_wait = printer.toolhead.axis_maximum.x|float / 2 %}
    {% set y_wait = printer.toolhead.axis_maximum.y|float / 2 %}

    SET_LED LED="rgb_light" RED=1 GREEN=0 BLUE=0 WHITE=0 SYNC=0 TRANSMIT=1

    # Clear Configuration
    BED_MESH_CLEAR

    # Initial Homing
    SET_HEATER_TEMPERATURE HEATER=extruder TARGET=160            ; pre-heat nozzle
    SET_HEATER_TEMPERATURE HEATER=heater_bed TARGET={target_bed} ; pre-heat bed
   
    G28 X Y                                      ; home xy 
    G0 X175 Y175                                 ; move to middle for homing z
    TEMPERATURE_WAIT SENSOR=extruder MAXIMUM=175 ; wait for calibration temp for homing z
    G28 Z                                        ; home z
    G0 Z2                                        ; position beacon at 2mm for heat soak
 
    # Leveling 
    QUAD_GANTRY_LEVEL                       
   
    # Calibrate Z 
    # WIPE_NOZZLE                       ;wipe nozzle
    TEMPERATURE_WAIT SENSOR=extruder MAXIMUM=175
    G28 Z METHOD=CONTACT CALIBRATE=1    ; calibrate z offset and beacon model hot
    BED_MESH_CALIBRATE ADAPTIVE=1       ; bed mesh

    # Prepare Hotend 
    G0 X175 Y175 Z15
    SET_HEATER_TEMPERATURE HEATER=extruder TARGET={target_extruder} ; set extruder to print temp
    TEMPERATURE_WAIT SENSOR=extruder MINIMUM={target_extruder}      ; wait for extruder temp
    TEMPERATURE_WAIT SENSOR=heater_bed MINIMUM={target_bed}

    SET_GCODE_OFFSET Z={target_offset}  ; add a little offset for hotend thermal expansion
                                        ; needs fine tuning, long meltzones require more
    PRIME_NOZZLE                        ; prime nozzle

    # Ready
    SET_LED LED="rgb_light" RED=1 GREEN=0 BLUE=1 WHITE=0 SYNC=0 TRANSMIT=1
   

#   Use PRINT_END for the slicer ending script - please customise for your slicer of choice
[gcode_macro PRINT_END]
gcode:
    # safe anti-stringing move coords
    {% set th = printer.toolhead %}
    {% set x_safe = th.position.x + 20 * (1 if th.axis_maximum.x - th.position.x > 20 else -1) %}
    {% set y_safe = th.position.y + 20 * (1 if th.axis_maximum.y - th.position.y > 20 else -1) %}
    {% set z_safe = [th.position.z + 2, th.axis_maximum.z]|min %}
    
    SAVE_GCODE_STATE NAME=STATE_PRINT_END
    
    M400                           ; wait for buffer to clear
    G92 E0                         ; zero the extruder
    G1 E-5.0 F1800                 ; retract filament
    
    TURN_OFF_HEATERS
    
    G90                                      ; absolute positioning
    G0 X{x_safe} Y{y_safe} Z{z_safe} F20000  ; move nozzle to remove stringing
    G0 X{th.axis_maximum.x//2} Y{th.axis_maximum.y - 2} F3600  ; park nozzle at rear
    M107                                     ; turn off fan
    
    BED_MESH_CLEAR
    RESTORE_GCODE_STATE NAME=STATE_PRINT_END
    SET_LED LED="rgb_light" RED=0 GREEN=1 BLUE=0 WHITE=0 SYNC=0 TRANSMIT=1

